USE MASTER
GO
IF EXISTS(select * from sys.databases where name='HR')
DROP DATABASE [HR]
GO

CREATE DATABASE [HR]
GO
USE [HR]
GO


CREATE TABLE [dbo].[COUNTRIES](
	[COUNTRY_ID] [char](2) NOT NULL,
	[COUNTRY_NAME] [varchar](40) NULL,
	[REGION_ID] [float] NULL,
 CONSTRAINT [COUNTRY_C_ID_PK] PRIMARY KEY CLUSTERED 
(
	[COUNTRY_ID] ASC
))
GO

CREATE TABLE [dbo].[DEPARTMENTS](
	[DEPARTMENT_ID] [numeric](4, 0) NOT NULL,
	[DEPARTMENT_NAME] [varchar](30) NOT NULL,
	[MANAGER_ID] [numeric](6, 0) NULL,
	[LOCATION_ID] [numeric](4, 0) NULL,
 CONSTRAINT [DEPT_ID_PK] PRIMARY KEY CLUSTERED 
(
	[DEPARTMENT_ID] ASC
))
GO

CREATE TABLE [dbo].[EMPLOYEES](
	[EMPLOYEE_ID] [numeric](6, 0) NOT NULL,
	[FIRST_NAME] [varchar](20) NULL,
	[LAST_NAME] [varchar](25) NOT NULL,
	[EMAIL] [varchar](25) NOT NULL,
	[PHONE_NUMBER] [varchar](20) NULL,
	[HIRE_DATE] [datetime2](0) NOT NULL,
	[JOB_ID] [varchar](10) NOT NULL,
	[SALARY] [numeric](8, 2) NULL,
	[COMMISSION_PCT] [numeric](2, 2) NULL,
	[MANAGER_ID] [numeric](6, 0) NULL,
	[DEPARTMENT_ID] [numeric](4, 0) NULL,
	[ROWID] [uniqueidentifier] NOT NULL,
 CONSTRAINT [EMP_EMP_ID_PK] PRIMARY KEY CLUSTERED 
(
	[EMPLOYEE_ID] ASC
))
GO

CREATE TABLE [dbo].[EMPS](
	[EMPLOYEE_ID] [numeric](6, 0) NULL,
	[FIRST_NAME] [varchar](20) NULL,
	[LAST_NAME] [varchar](25) NOT NULL,
	[EMAIL] [varchar](25) NOT NULL,
	[PHONE_NUMBER] [varchar](20) NULL,
	[HIRE_DATE] [datetime2](0) NOT NULL,
	[JOB_ID] [varchar](10) NOT NULL,
	[SALARY] [numeric](8, 2) NULL,
	[COMMISSION_PCT] [numeric](2, 2) NULL,
	[MANAGER_ID] [numeric](6, 0) NULL,
	[DEPARTMENT_ID] [numeric](4, 0) NULL
) ON [PRIMARY]
GO

CREATE TABLE [dbo].[HR_EMP_STAT_TAB](
	[STATID] [varchar](30) NULL,
	[TYPE] [char](1) NULL,
	[VERSION] [float] NULL,
	[FLAGS] [float] NULL,
	[C1] [varchar](30) NULL,
	[C2] [varchar](30) NULL,
	[C3] [varchar](30) NULL,
	[C4] [varchar](30) NULL,
	[C5] [varchar](30) NULL,
	[N1] [float] NULL,
	[N2] [float] NULL,
	[N3] [float] NULL,
	[N4] [float] NULL,
	[N5] [float] NULL,
	[N6] [float] NULL,
	[N7] [float] NULL,
	[N8] [float] NULL,
	[N9] [float] NULL,
	[N10] [float] NULL,
	[N11] [float] NULL,
	[N12] [float] NULL,
	[D1] [datetime2](0) NULL,
	[R1] [varbinary](32) NULL,
	[R2] [varbinary](32) NULL,
	[CH1] [varchar](1000) NULL,
	[CL1] [varchar](max) NULL
) ON [PRIMARY] TEXTIMAGE_ON [PRIMARY]
GO

CREATE TABLE [dbo].[JOB_HISTORY](
	[EMPLOYEE_ID] [numeric](6, 0) NOT NULL,
	[START_DATE] [datetime2](0) NOT NULL,
	[END_DATE] [datetime2](0) NOT NULL,
	[JOB_ID] [varchar](10) NOT NULL,
	[DEPARTMENT_ID] [numeric](4, 0) NULL,
 CONSTRAINT [JHIST_EMP_ID_ST_DATE_PK] PRIMARY KEY CLUSTERED 
(
	[EMPLOYEE_ID] ASC,
	[START_DATE] ASC
))

CREATE TABLE [dbo].[JOBS](
	[JOB_ID] [varchar](10) NOT NULL,
	[JOB_TITLE] [varchar](35) NOT NULL,
	[MIN_SALARY] [numeric](6, 0) NULL,
	[MAX_SALARY] [numeric](6, 0) NULL,
 CONSTRAINT [JOB_ID_PK] PRIMARY KEY CLUSTERED 
(
	[JOB_ID] ASC
))
GO


CREATE TABLE [dbo].[LOCATIONS](
	[LOCATION_ID] [numeric](4, 0) NOT NULL,
	[STREET_ADDRESS] [varchar](40) NULL,
	[POSTAL_CODE] [varchar](12) NULL,
	[CITY] [varchar](30) NOT NULL,
	[STATE_PROVINCE] [varchar](25) NULL,
	[COUNTRY_ID] [char](2) NULL,
 CONSTRAINT [LOC_ID_PK] PRIMARY KEY CLUSTERED 
(
	[LOCATION_ID] ASC
))
GO

CREATE TABLE [dbo].[REGIONS](
	[REGION_ID] [float] NOT NULL,
	[REGION_NAME] [varchar](25) NULL,
 CONSTRAINT [REG_ID_PK] PRIMARY KEY CLUSTERED 
(
	[REGION_ID] ASC
))
GO

